import styled from 'styled-components';
import SignUpWith from '../pages/signuppage/SignUpPage';

let StyledContainer = styled.div`
background-color:red;
width:500px;
margin:0 auto;
display:flex;
justify-content:center;
flex-direction:column;
align-items:center;
`;
let StyledButton = styled.button`
width:70%;
height:35px;
margin:3px 0px;
font-family:-apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
font-weight:bold;
border-radius:10px;
border:2px solid black;
cursor: pointer;
background-color:#ffffff;
outline:none;
&:hover{
        background: rgba(255,255,255,.8);
        color: black;
     }
`
let StyledTitle = styled.h1`
font-size:20px;
color:white;
margin:5px 0px;
`

const SignUpPopup = () => {
    return (
        // <StyledContainer>
        //     <StyledTitle>Just let me in already</StyledTitle>
        //     <StyledContainer>
        //         <StyledButton>Sign up with Facebook</StyledButton>
        //         <StyledButton>Sign up with Gmail</StyledButton>
        //         <StyledButton>Sign up with Apple</StyledButton>
        //     </StyledContainer>
        //     <StyledTitle>Signing up regularly</StyledTitle>
        //     <StyledButton>Signup with Email</StyledButton>
        // </StyledContainer>
        <SignUpWith/>

    )
}
export default SignUpPopup;
